  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Lostwood National
  Wildlife Refuge outlines Refuge accomplishments from May through August of 1948.
  The report begins by summarizing the weather conditions, water conditions, and wildfires
  during this period. Wildlife- including migratory birds, upland game birds, big
  game animals, furbearers, predators, and rodents- is also covered. The Refuge development
  and maintenance section discusses physical developments and plantings. A progress
  report on field investigations and applied research is also provided. The public
  relations section of the report describes Refuge visitors. N-R forms are attached.\",\n\t\"owner_org\":
